import React, { Component } from 'react'
import $ from 'jquery';

export class Gallery extends Component {

  state = {
    resumeData : {},
  }
  getResumeData(){
    $.ajax({
      url:'/data.json',
      dataType:'json',
      cache: false,
      success: function(data){
        this.setState({resumeData: data});
      }.bind(this),
      error: function(xhr, status, err){
        console.log(err);
        alert(err);
      }
    });
  }
  componentDidMount(){
    this.getResumeData();
  }
  render() {

    return (

        <div id="portfolio">
        <h1>{this.props.data ? this.props.data.phone : 'loading'}</h1>
      </div>
    )
  }
}

export default Gallery
